    "2015-09-26T19:53:59.608937",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surf4824f",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0117499 includes Surface
    underway, chemical, meteorological and physical data collected from L'ASTROLABE
    in the Indian Ocean, South Pacific Ocean and Tasman Sea from 2008-10-21 to 2011-03-05
    and retrieved during cruise 353L20081021. These data include AIR-SEA DIFFERENCE
    - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, Partial
    pressure (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity)
    of carbon dioxide - water, SALINITY, SEA SURFACE TEMPERATURE, WIND DIRECTION and
    WIND SPEED. The instruments used to collect these data include Carbon dioxide (CO2)
    gas analyzer and Shower head chamber equilibrator for autonomous carbon dioxide
    (CO2) measurement. These data were collected by Bronte Tilbrook of Commonwealth
    Scientific and Industrial Research Organization as part of the VOS_L_Astrolabe_2008_2010
    data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
    UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
    from 14 countries have been outfitting research ships and commercial vessels with
    automated CO2 sampling equipment to analyze the carbon exchange between the ocean
    and atmosphere.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
